css:
#linter-inline {
  white-space: pre !important;
}
.linter-message-item {
  margin-left: 3px;
  margin-bottom: initial;
}
linter-message {
  font-size: 12px;
  line-height: 1.6;
}
linter-multiline-message {
  display: block;
  pointer-events: auto;
}
linter-multiline-message linter-message-line {
  display: block;
  white-space: pre;
}
linter-multiline-message linter-message-line:not(:first-child) {
  display: block;
  white-space: pre;
}
linter-multiline-message linter-message-line:first-child:not( :nth-last-of-type(1))::before {
  display: none;
}
